Располагалась между Каррейра и ручьем Сан-Жуан, сейчас входит в улицу доктора Виейра, ранее Каррейра.

Сегодня площадь перед часовней Сан-Паулу носит то же название, а проулок, соединяющий эту площадь с улицей Рибейра, называется травесса-ди-Сан-Паулу. Раньше район часовни Сан-Паулу, включая окрестности, простирался до берега ручья Сан-Жуан.

